import React, { Component } from 'react';
import Header from './Components/Header';
import Skills from './Components/Skills';
import Projects from './Components/Projects';
import Map from './Components/Map';
import Contact from './Components/Contact';
import './App.css';

class Portfolio extends Component {
  render() {
    let portfolioStyle = {
      fontFamily: "Rokkitt",
    }
    let footerStyle = {
      textAlign: 'center',
      margin: "10px auto 40px auto",
      fontSize: '1.2em'
    }
    let githubSection = {
      textAlign: 'center',
      margin: '15px auto',
      fontSize: '1.2em'

    }

    return (
      <div id="portfolio" className={"container"} style={portfolioStyle}>
            <Header />
            <Skills />
            <Projects />
            <div>Info Section 1</div>
            <div>Info Section 2</div>
            <div style={githubSection}>
              <h3>DO I HAVE A GITHUB?</h3>
              <a href="http://www.github.com/sleighs" target="blank">Yes.</a>
            </div>
            <Map />
            <Contact />
            <footer style={footerStyle}>
              <p>Thank you for reading!</p>
              <p>
                <a href="http://www.github.com/sleighs/cv" target="blank">View The Source Code</a>
              </p>
            </footer>
      </div>
    );
  }
}

export default Portfolio;
